import Link from 'next/link';
import Router, { withRouter } from 'next/router';
import { Flex, List, ListItem, Heading } from '@chakra-ui/core';

const Nav = () => {
  Router.pathname; // '/'
  Router.query; // {name: "jaga"}
  Router.route; // '/'

  return (
    <List as={Flex} justifyContent="space-evenly" paddingBottom="2rem">
      <ListItem>
        <Link href="/history">
          <a>
            <Heading as="h1" size="2xl">
              History
            </Heading>
          </a>
        </Link>
      </ListItem>
      <ListItem>
        <Link href="/">
          <a>
            <Heading as="h1" size="2xl">
              Home
            </Heading>
          </a>
        </Link>
      </ListItem>
    </List>
  );
};

export default Nav;
